      <div class="border-b-2 border-neutral-100 px-6 py-3 dark:border-white/10">
        Quote
      </div>
      <div class="p-6">
        <div>
          <p class="text-xl">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer
            posuere erat a ante.
          </p>
        </div>
      </div>
    </div>
  );
};

